let obj = data.regions;
let my_obj = {};
let finalObj = {};

const swapFunction = async (obj) => {
  for (const [key, value] of Object.entries(obj)) {
    // console.log(`${key}`);
    let citesArray = [];
    value.forEach((item) => {
      citesArray.push(item.name);
    });
    my_obj[key] = citesArray;
  }
  for (let [key, value] of Object.entries(my_obj)) {
    // console.log(`${key}`);
    var lowerKey = key.toLowerCase();
    value.forEach((item) => {
      var lowerItem = item.toLowerCase();

      if (lowerItem.includes(" (nj)")) {
        lowerItem = "new york";
      }
      if (lowerItem in finalObj) {
        finalObj[lowerItem].push(lowerKey);
      } else {
        finalObj[lowerItem] = [lowerKey];
      }
    });
  }
  return Promise.resolve(getContry(finalObj));
};
// console.log("my obj",my_obj)

const getContry = async (finalObj) => {
  let countryObj = [];
  for (let [key, value] of Object.entries(finalObj)) {
    let finalURL =
      "http://api.weatherapi.com/v1/current.json?key=e9651d29e9f94d85bce61916222502&q=";
    // console.log("value",value)
    const response = await fetch(finalURL + key);
    const data = await response.json();
    let contry = data.location.country;
    let tempFlag = "";
    dataArray.forEach((item) => {
      if (item.country.toLowerCase() == contry.toLowerCase()) {
        tempFlag = item.flag_base64;
      }
    });
    // let tempProviders=[]
    // providersLogosObj.forEach((item,index)=>{
    //   //  console.log("Value",value);
    //   // console.log("ITEM1",item[value])
    //   // console.log("HAMZa",item[value]===value[index])
    //    if(item[value]!==value[index]){
    //     //  console.log("ITEM",item[value])
    //    }
    //    else{
    //      tempProviders.push((item[value]))
    //    }
    // })
    // console.log("TEMP PROVIDER",tempProviders)
    if (contry == "United States of America") {
      contry = "USA";
    }
    let tempObj = {
      country: contry,
      city: key,
      region: data.location.tz_id.split("/")[0],
      providers: value,
      flag: tempFlag,
    };
    countryObj.push(tempObj);
  }
  console.log(countryObj);
  displayDataCenterUI(countryObj)
};

const displayDataCenterUI = (countryObj) => {
  let htmlDiv=``
  countryObj.map((elem)=>{
      let ulContent="";
      let logo;
      elem.providers.forEach((item)=>{
        switch (item) {
          case 'amazon':
              logo = "data:image/svg+xml;base64,";
              break;
          case 'do':
              logo = 'data:image/svg+xml;base64,';
              break;
          case 'linode':
              logo = 'data:image/svg+xml;base64,'
              break;
          case 'gce':
              logo = 'data:image/svg+xml;base64,';
              break;
          case 'vultr':
              logo = 'data:image/svg+xml;base64,';
              break;
            }
            ulContent = ulContent + (`<li><img src='${logo}' /></li>`)
      })
      // console.log("hamza",ulContent)
        htmlDiv = `
        <div class="box ${elem.region.toLowerCase()}">
              <a href="">
                <div class="cardCntryBox">
                  <div class="cardCntryBoxTxt">
                    <h3>${elem.country}</h3>
                    <p>${elem.city}</p>
                  </div>

                  <div class="cardCntryBoxflag">
                    <img
                    src="${elem.flag}"
                      alt=""
                      class="img-fluid"
                    />
                  </div>
                </div>

                <div class="cardPrvdrBox">
                  <ul class="providers">
                    ${ulContent}
                  </ul>
                </div>
              </a>
            </div>`;

        document.querySelector(".cardsWrap").innerHTML += htmlDiv;

  })
filterfunc()
};

