function filterfunc(){
  const providerBoxes = document.querySelectorAll('.box');
  
  const filterBoxes = (filterValue) => {   
      providerBoxes.forEach(item => {
          item.classList.remove("hide")
          if (!item.className.includes(filterValue) && filterValue!=='all-locations') {
              item.classList.add("hide")
          }
      })
  }
  const activeLi=document.querySelectorAll(".dataCenterNavBar ul li")
  const filterActives=(value)=>{
    
    activeLi.forEach(item =>{
      item.classList.remove('active')
    })
    console.log("hamza",value.parentElement.classList.add('active'))
  }
  
  var filters = document.querySelectorAll('.applyFilter');
  filters.forEach(elem => elem.addEventListener('click', event => {
    let filterValue = event.target.getAttribute("data-filter");
    filterActives(event.target)
    filterBoxes(filterValue);
  }));
}
